import src from "*.jpeg";

export type DialogType = {
    name: string
    id: number
}

export type MessegeType = {
    message: string
    id: number
}

export type PostType = {
    message: string
    id: number
    likecount: string
}

export type ProfilPageType= {
    posts: Array<PostType>

}

export type DialogPageType= {
    dialogs: Array<DialogType>
    messages: Array<MessegeType>
}
export type StateType = {
    profilPage: ProfilPageType
    dialogPage: DialogPageType
}



let state: StateType = {
    profilPage:{
        posts: [
            { message: 'Hi, how are you?', id: 1, likecount: "15" },
            { message: "It's my first post", id: 2, likecount: "16" },
            { message: "blablabla", id: 3, likecount: "11" }
        ]},
    dialogPage:{
        dialogs: [
            { name: 'Dima', id: 1, img: src },
            { name: 'Andrey', id: 2 },
            { name: 'Alex', id: 3 },
            { name: 'Sveta', id: 4 },
            { name: 'Vova', id: 5 },
            { name: 'Dora', id: 6 },
            { name: 'Oleg', id: 7 }
        ],
        messages: [
            { message: 'hi', id: 1 },
            { message: 'good morning', id: 2 },
            { message: 'hello', id: 3 },
            { message: 'yo', id: 4 },
            { message: 'How is going', id: 5 },
            { message: 'Good bay', id: 6 },
            { message: 'good night', id: 7 }
        ]}
}

export default state
